import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import MocionesList from './components/MocionesList';
import CreateMocion from './components/CreateMocion';
import EditMocion from './components/EditMocion';
import ViewMocion from './components/ViewMocion';

function App() {
    return (
        <Router>
            <div>
                <Routes>
                    <Route path="/" element={<MocionesList />} />
                    <Route path="/crear" element={<CreateMocion />} />
                    <Route path="/editar/:id" element={<EditMocion />} />
                    <Route path="/ver/:id" element={<ViewMocion />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
